ana esto viabilizando nveis mais elevados de autonomia em Sistemas Ciberfsicos (CPS) modernos. Garantir uma operao autnoma segura requer a estrita observncia das restries de tempo e segurana, melhor expressas em termos dos dados consumidos, em vez das tarefas executadas. Esta palestra apresenta um design Data-Centric para Sistemas Orientados a Dados, utilizando o conceito de SmartData, uma construo de dados enriquecida com metadados para encapsular origem, semntica e relacionamentos. O SmartData interage por meio de relaes de Interesse, herdando requisitos como frescura, periodicidade e segurana. Atravs deste design, uma clara relao com lgicas temporais surge, permitindo a derivao de propriedades do sistema de forma automatizada e permitindo a verificao em tempo de execuo.","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/x1bPzUG9v3Y/hqdefault.jpg?v=68b203b4\u0026sqp=CLSEqMYG-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLBBsgKs249WbGrcC7A0bl_UlYb84A","width":168,"height":94},{"url":"https://i.ytimg.com/vi/x1bPzUG9v3Y/hqdefault.jpg?v=68b203b4\u0026sqp=CLSEqMYG-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLB53xiGQgSH8NTkyGC-bJ-o8eSNzQ","width":196,"height":110},{"url":"https://i.ytimg.com/vi/x1bPzUG9v3Y/hqdefault.jpg?v=68b203b4\u0026sqp=CLSEqMYG-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLBM_bBaMwsa-niERO4JfGthsh0KMQ","width":246,"height":138},{"url":"https://i.ytimg.com/vi/x1bPzUG9v3Y/hqdefault.jpg?v=68b203b4\u0026sqp=CLSEqMYG-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLCUELPSAHWiCHVsPysN8HmUGrbjxA","width":336,"height":188}]},"allowRatings":true,"viewCount":"98","author":"Forum da Ps-Graduao em Computao do Paran","isLowLatencyLiveStream":true,"isPrivate":false,"isUnpluggedCorpus":false,"latencyClass":"MDE_STREAM_OPTIMIZATIONS_RENDERER_LATENCY_LOW","isLiveContent":true,"isPostLiveDvr":true},"annotations":[{"playerAnnotationsExpandedRenderer"
